import React from 'react'
import { Button } from './button'
import styles from './style.css'

const Nav = () => {
  return (
    <nav>
      <img id='logo' src='/images/logo.svg' alt='' />
      <ul id='ul'>
        <List name='HOW WE WORK' />
        <List name='BLOG' />
        <List name='ACCOUNT' />
        <Button name='VIEW PLANS' />
      </ul>
    </nav>
  )
}

const List = (props) => {
  return <li className='list'>{props.name}</li>
}

export default Nav
